import React from 'react'
import {StyleSheet} from 'react-native'

const styles = StyleSheet.create({
    title: {
        flex:1,
        justifyContent: 'center',
        backgroundColor:'red',
        textAlign:'center',
        textTransform : 'uppercase'
    },
    title2: {
        flex:1,
        justifyContent: 'center',
        backgroundColor:'green',
        textAlign:'center'
    }
})

export {styles}
